  false,\n\t\"url\": null,\n\t\"notes\": \"NODC Accession 0113582 includes chemical,
  discrete sample, physical and profile data collected from METEOR in the North Atlantic
  Ocean from 1996-09-10 to 1996-10-03 and retrieved during cruise 06MT19960910 (06MT365).
  These data include ALKALINITY, DISSOLVED OXYGEN, HYDROSTATIC PRESSURE, NITRATE,
  PHOSPHATE, Potential temperature (theta), SALINITY, SILICATE, WATER TEMPERATURE
  and pH. The instruments used to collect these data include CTD and bottle. These
  data were collected by F. Perez of Commonwealth Scientific and Industrial Research
  Organization and C. Hemleben [affiliation unknown] as part of the CARINA/06MT19960910
  data set.nnThe CARINA (CARbon dioxide IN the Atlantic Ocean) data synthesis project
  is an international collaborative effort of the EU IP CARBOOCEAN, and U.S. partners.
  It has produced a merged internally consistent data set of open ocean subsurface
  measurements for biogeochemical investigations, in particular, studies involving
  the carbon system. The original focus area was the North Atlantic Ocean, but over
  time the geographic extent expanded and CARINA now includes data from the entire
  Atlantic, the Arctic Ocean, and the Southern Ocean.\",\n\t\"owner_org\": \"e811f0b4-451f-4896-9e8f-fc6802837819\",\n\t\"extras\":
